import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {BrowserRouter,Route,Routes,Navigate} from "react-router-dom";
import MyDesignes from './component/Mydesignes/mydesignes';
import DesignInfo from './component/myDesigneInfo/DesignInfo';
import MyPrinters from './component/Myprinters/MyPrinters';
import MetamaskLogin from './component/metamaskLogin/metamaskLogin';
import PrinterDetails from './component/Myprinters/PrinterDetails/PrinterDetails'
import SignIn from './component/signin/SignIn';
import { AccountCheck } from './component/signin/userLoginCheck';
import { useContext } from 'react';
import { UserContext } from './component/Context/userLogContext';

const root = ReactDOM.createRoot(document.getElementById('root'));
const {username,account}=useContext(UserContext)
root.render(

  <BrowserRouter>
  <Routes>
    <Route path="/" element={<App/>}></Route>
    <Route path="/login" element={<MetamaskLogin/>}></Route>
    <Route path="/signin" element={<SignIn/>}></Route>
    <Route path="myprinters" render={()=>{
      AccountCheck()?(
        <Navigate replace to="/login"/>):(<Navigate replace to="/"/>)
      }

    }
     element={<MyPrinters/>}></Route>
      <Route path='myprinters/:printerDetails' element={<PrinterDetails/>}/>

    <Route path="mydesignes" element={<MyDesignes/>}></Route>
      <Route path="mydesignes/:designInfo" element={<DesignInfo/>}>
    </Route>
  </Routes>
  </BrowserRouter>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
